import React from 'react'
import './TP.css'
import Product from '../Product/Product'
import { featProd } from '../../products'

const TopPicks = () => {
  return (
    <div className="top-items">
        {featProd.map((product)=>(
            <div key={product.id}>
                <Product product = {product}/>
            </div>
        ))}
      </div>
  )
}

export default TopPicks
